window.bookSummaryJSON = "<p>Break the new girl. That should be easy, right? Trash like her doesn’t belong at Burberry Prep. No, Marnye Reed is going down, and we plan to make a spectacle out of it. Let’s see who can make her fall in love first. Bet’s on. Any takers?</p> <p>Take on the filthy rich boys. They’re the idols of the school, veritable gods on earth. Old money. New money. A rising star. These guys are nothing like the ones at my old school. I might come from nothing, but I’m determined to be someone, and I won’t let them get in my way. They say they’ll make my life a living hell; I think they mean to keep that promise.&nbsp;</p> <p><i>Filthy Rich Boys</i> is a 97,000 word reverse harem/mature high school bully romance novel. This is book one of four in the series. Contains foul language and sexual scenes; any sex featured is consensual.</p>"; 
